import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import UserInfo from './components/UserInfo';
import CompletionStatus from './components/CompletionStatus';
import WeeklyReport from './components/WeeklyReport';
import TriggerAnalysis from './components/TriggerAnalysis';
import BingeEatingAnalysis from './components/BingeEatingAnalysis';
import PositiveMealAnalysis from './components/PositiveMealAnalysis';
import Settings from './components/Settings'; 
import './App.css';

function App() {

  const startDate = '7.22';
  const endDate = '7.28';

  //모바일 실제 화면 크기에 맞추기
  // function setScreenSize() {
  //   let vh = window.innerHeight * 0.01;
  //   document.documentElement.style.setProperty("--vh", `${vh}px`);
  // }
  // useEffect(() => {
  //   setScreenSize();
  // });

  return (
    <Router>
      <div className='App'>
        <Header />
        <Switch>
          <Route path="/" exact>
            <UserInfo name='김예원' daysManaged={72} />
            <CompletionStatus mealManagement={6} quizCompletion={6} />
            <WeeklyReport startDate={startDate} endDate={endDate} />
            <TriggerAnalysis />
            <BingeEatingAnalysis />
            <PositiveMealAnalysis />
          </Route>
          <Route path="/settings" component={Settings} /> {/* 설정 페이지 라우트 추가 */}
          {/* 다른 페이지 라우트를 여기에 추가 */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
